import { Router, Switch, Redirect } from "react-router-dom";
import Page1 from "./pages/Page1";
import Page2 from "./pages/Page2";
import Page3 from "./pages/Page3";

function App() {
  return (
    <div>
      <Switch>
        <Router path="/" exact>
          <Redirect to="/qu" />
        </Router>
        <Router path="/page1">
          <Page1 />
        </Router>
        <Router path="/page2">
          <Page2 />
        </Router>
        <Router path="/page3">
          <Page3 />
        </Router>
      </Switch>
    </div>
  );
}

export default App;
